import React, { Component } from 'react';
import { FaFacebook, FaGooglePlusG, FaTwitter, FaLinkedin, FaInstagram} from 'react-icons/fa';


class TopNavLeftIcon extends Component {
    render(){
        return (
            <ul className="list-inline hover-red">
                <li><a href="https://www.facebook.com/" title="Facebook" target="_blank"><FaFacebook/></a></li>
                <li><a href="https://plus.google.com/" title="Google+" target="_blank"><FaGooglePlusG/></a></li>
                <li><a href="https://twitter.com" title="Twitter" target="_blank"></a><FaTwitter/></li>
                <li><a href="https://www.linkedin.com" title="LinkedIn" target="_blank"><FaLinkedin/></a></li>
                <li><a href="https://www.instagram.com" title="Instagram" target="_blank"><FaInstagram/></a></li>
            </ul>
        );
        }
}

export default TopNavLeftIcon;
